hex_string = ""
byte_string = bytes.fromhex(hex_string)
ascii_string = byte_string.decode("ASCII")
ascii_arr = ascii_string.split("  ")
tmp = ''

splitted = []
for i in range(len(ascii_arr)):
    splitted = [x for x in ascii_arr[i]]
    for j in range(0,len(splitted),2):
        tmp = splitted[j]
        splitted[j] = splitted[j + 1]
        splitted[j + 1] = tmp
    tmp = "".join(splitted)
    tmp = tmp.lstrip()
    ascii_arr[i] = tmp
ascii_arr = '\n'.join(ascii_arr)
print(ascii_arr)